You can use flake-compat to provide the default outputs of the flake for non-flake users. If you aren't using flakes, you can do (in your default.nix file for example): let nciSrc = fetchTarball { url = "https://github.com/yusdacra/nix-cargo-integration/archive/<rev>.tar.gz"; sha256 = "<hash>"; }; nci = import nciSrc;
in nci.makeOutputs { root = ./.; } You can also couple it with niv : First run niv add yusdacra/nix-cargo-integration Then you can write in your default.nix file: let sources = import ./sources.nix; nci = import sources.nix-cargo-integration;
in nci.makeOutputs { root = ./.; }
